import React from 'react';
import "./menu.css"

function Menubox({Name,Area,img}) {
  return <div  className='menubox'>
      <h1>Menu</h1>
       <h2 className='menuName'>{Name}</h2>
      <div><img src={img} width="250"/></div>
      <h3 className='menuArea'>country:{Area}</h3>
  </div>;
}

export default Menubox;
